import React from 'react';
import './SubmissionLink.css';

const SubmissionLink = ({ onClick }) => {
  return (
    <a href="#submission-dialog" className="submission-link" onClick={onClick}>
      Submit Work
    </a>
  );
};

export default SubmissionLink;
